import React from "react";

const Header = () => {
    return (
      <header>
        <button onClick={work}>Im a button</button>

        
        <h1>My Website</h1>
        <nav>
          <ul>
            <li>Home</li>
            <li>About</li>
            <li>Contact</li>
          </ul>
        </nav>
      </header>
    );
  };
  
  export default Header;
